import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar=()=>{
    return (
        <div>

                <NavLink to='/home'>Home</NavLink>
                <NavLink to='/summary'>Summary</NavLink>
                <NavLink to='/rooms'>Rooms</NavLink>

        </div>
    )
}


export default Navbar;
